import { connect } from "react-redux";

function Examples({ jobs }) {
  return (
    <div>
      {jobs.forEach(job => {
        return <span>{job.title}</span>;
      })}
    </div>
  );
}

function mapStateToProps(state) {
  const { jobs } = state;
  return { jobs };
}

export default connect(mapStateToProps)(Examples);
